import { makeStyles } from '@material-ui/core/styles';

export default makeStyles((theme) => ({
    root: {
        '& .MuiTextField-root': {
            margin: theme.spacing(10),
        },
    },
    paper: {
        padding: theme.spacing(10),
        background: 'rgba(255, 255, 255, 1)',
        borderRadius: 20,
        boxShadow: 50,
    },
    form: {
        display: 'flex',
        flexWrap: 'wrap',
        justifyContent: 'center',
        padding: 20,
        border: 10
    },
    fileInput: {
        width: '90%',
        margin: '10px 0',
    },
    buttonSubmit: {
        marginBottom: 10,
    },
}));
